@test integrate((a+a*cos(c+d*x))*cos(c+d*x), x) == :((1/2)*a*x+a*d^-1*sin(c+d*x)+(1/2)*a*d^-1*cos(c+d*x)*sin(c+d*x))
@test integrate(a+a*cos(c+d*x), x) == :(a*x+a*d^-1*sin(c+d*x))
